import { ProjectCard } from "./ProjectCard";
import projImg1 from "../assets/img/arbitrage.png";
import projImg2 from "../assets/img/japan.png";
import projImg3 from "../assets/img/indicchain.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';
import React from "react";

export const Projects = () => {

  const projects = [
    {
      title: "Arbitrage Bot",
      description: "Developed Responsive UI/UX",
      imgUrl: projImg1,
    },
    {
      title: "Maruhan Japan",
      description: "Design & Development Admin Panel",
      imgUrl: projImg2,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg3,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg1,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg2,
    },
    {
      title: "Business Startup",
      description: "Design & Development",
      imgUrl: projImg3,
    },
  ];

  return (
    <section className="project" id="project">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) =>
              <div className={isVisible ? "animate__animated animate__fadeIn": ""}>
